def get_new_dates():
    res = requests.get('http://www.tmjnews.net/review.asp?Page=1', headers=headers)
    html = etree.HTML(res.content.decode('gbk'))
    dates = html.xpath("//div[@class='review_list']/div[1]/ul/li/span/a")
    for date in dates:
        if date.xpath("./text()")[0].strip('期') not in data_dict.keys():
            data_dict[date.xpath("./text()")[0].strip('期')] = date.xpath("./@href")[0]




def get_tumenjiang_paper(paper_time, queue_id, webpage_id):
    # 将today的格式进行改变
    get_new_dates()
    day = paper_time
    paper_time = datetime.strptime(paper_time, '%Y-%m-%d').strftime('%Y%m%d')
    url = data_dict.get(paper_time)
    if not url:
        raise Exception(f'该日期没有报纸')
    response = requests.get(url, headers=headers)
    if response.status_code == 200:
        content = response.content.decode('gbk')
        html_1 = etree.HTML(content)
        # 获取所有版面的的链接
        all_bm = html_1.xpath("//div[@id='index_f_list']/ul/li")
        for bm in all_bm:
            # 版面名称
            bm_name = "".join(bm.xpath("./a/text()")).strip()
            # 版面链接
            bm_url = 'http://www.tmjnews.net/' + ''.join(bm.xpath("./a/@href"))
            # 获取版面详情
            bm_response = requests.get(bm_url, headers=headers)
            time.sleep(1)
            bm_content = bm_response.content.decode('gbk')
            bm_html = etree.HTML(bm_content)
